import React from "react";
import { Box, Grid } from "@material-ui/core";
import Item from "../components/Login/components/Item";

const Prueba = () => {
  return (
    <>
      <div className="container">
        <Grid container>
          <Grid item xs={12}>
            <Box border={6}>SJSSKKS</Box>
          </Grid>
        </Grid>
      </div>
    </>
  );
};

export default Prueba;
